import React, { Component } from "react";
import TeamMember from "./TeamMember";
import memberInfo from "./memberInfo"
import { useParams } from 'react-router';


class MemberDetails extends Component {
  render(){
    return(
        <div>
            <div className="card">
                <div className="card-header">
                    <img style={{maxWidth: '100%'}} src={this.props.match.params.img}/>
                </div>
                <div className="card-body" 
                     style={{backgroundColor : this.props.website ? "white" : "black"}}>
                    <h2>{this.props.match.params.name}</h2>
                    <h5>{this.props.match.params.position}</h5>
                    <div>{this.props.match.params.phone}</div>
                    <div>{this.props.match.params.email}</div>
                    <div>{this.props.match.params.website}</div>
                </div>
            </div>
        </div>
    )
}
}

export default MemberDetails;
